(549, 79, '_scheduling_image', 'field_5b030bb8bf734'),
(550, 79, 'scheduling_upper_text', '<p class="plain"><b>What to Expect at your First Session:</b></p>\r\n\r\n<div class="plain">We ask that you arrive five to ten minutes early to complete the intake paperwork. The office staff will assist you with any paperwork, explain our confidentiality, financial and cancellation policies, and answer any questions you may have. We have a comfortable waiting room with magazines, puzzles, and toys.</div>\r\n<div class="plain">Your therapist will come and get you at the start of your appointment. Once in your session, your therapist will reiterate our confidentiality policies and check to see if you have any questions about the process. The purpose of the first session is for the therapist to get to know you and for you to determine if our clinic and your therapist are a good fit.</div>'),
(551, 79, '_scheduling_upper_text', 'field_5b030bc5e81f9'),
(552, 11, 'scheduling_image', '32'),
(553, 11, '_scheduling_image', 'field_5b030bb8bf734'),
(554, 11, 'scheduling_upper_text', '<h4 class="plain"><b>What to Expect at your First Session:</b></h4>\r\n<div class="plain">We ask that you arrive five to ten minutes early to complete the intake paperwork. The office staff will assist you with any paperwork, explain our confidentiality, financial and cancellation policies, and answer any questions you may have. We have a comfortable waiting room with magazines, puzzles, and toys. Your therapist will come and get you at the start of your appointment. Once in your session, your therapist will reiterate our confidentiality policies and check to see if you have any questions about the process. The purpose of the first session is for the therapist to get to know you and for you to determine if our clinic and your therapist are a good fit.</div>'),
(555, 11, '_scheduling_upper_text', 'field_5b030bc5e81f9'),
(556, 78, 'field_5b0311b4c4b20', 'a:11:{s:3:"key";s:19:"field_5b0311b4c4b20";s:5:"label";s:31:"Scheduling Lower Text Section 1";s:4:"name";s:31:"scheduling_lower_text_section_1";s:4:"type";s:7:"wysiwyg";s:12:"instructions";s:0:"";s:8:"required";s:1:"0";s:13:"default_value";s:0:"";s:7:"toolbar";s:4:"full";s:12:"media_upload";s:3:"yes";s:17:"conditional_logic";a:3:{s:6:"status";s:1:"0";s:5:"rules";a:1:{i:0;a:2:{s:5:"field";s:4:"null";s:8:"operator";s:2:"==";}}s:8:"allorany";s:3:"all";}s:8:"order_no";i:2;}'),
