(574, 11, 'scheduling_lower_text_section_1', '<h4 class="plain"><b>Cost:</b></h4>\r\n<div class="plain">Initial Session: $190.00</div>\r\n<div class="plain">Regular Session (45 min): $155.00</div>\r\n<div class="plain">Extended Session (60 min): $195.00</div>\r\n<div>\r\n<h4 class="plain"><b>Insurance:</b></h4>\r\n<div class="plain">We accept most third-party insurances, and Wisconsin and Minnesota Medical Assistance.</div>\r\n<div class="plain">Insurance co-payments are due at the time of your appointment.</div>\r\n<div class="plain">As a courtesy to you, we will bill your insurance company and do all we can to receive payment for claims. However, because the contract is between you and your insurance company, you are ultimately responsible for any outstanding charges.</div>\r\n</div>\r\n<div>\r\n<div></div>\r\n<h4 class="plain"><b>Sliding Fee Scale and Payment Plans:</b></h4>\r\n<div class="plain">A sliding fee scale (based on family size and gross family income) is available for those who do not have private insurance or medical assistance. A payment plan can also be tailored to accommodate specific financial situations.</div>\r\n<div class="plain">Payments are due at the time of your appointment unless prior arrangements have been made.</div>\r\n</div>\r\n<div></div>\r\n<div>\r\n<h4 class="plain"><b>Cancellation Policy:</b></h4>\r\n<div class="plain">Because the time of your appointment is reserved just for you, we ask that you call our office 24 hours prior to your appointment if you need to cancel for any reason. For any late cancellations or missed appointments there is a $50 fee charged to you, not your insurance provider.</div>\r\n</div>'),
(575, 11, '_scheduling_lower_text_section_1', 'field_5b0311b4c4b20'),
