(1150, 137, 'home_main_content', 'Peace Tree Counseling provides a safe, supportive, confidential environment where individuals, couples and families can learn to engage life more fully. We are dedicated to helping you identify and develop your own personal strengths, increase self-confidence, improve communication skills, and bring resolution to issues which hinder wholeness and well-being.\r\n\r\n<em>We are proud that Peace Tree Counseling is Handicapped Accessible and GLBT Friendly.</em>'),
