(13, 1, '2018-05-19 11:34:30', '2018-05-19 11:34:30', '<h3 class="">Mental Health Counselor – LPC, LMFT, or LCSW</h3>\r\nPeace Tree Counseling, LLC is accepting resumes for Mental Health Counselors for the assessment, and treatment of clients experiencing mental health disorders. The chosen applicant must be willing to begin part-time as s/he builds up to a full-time caseload.\r\n<h4><b>Minimum Requirements:</b></h4>\r\n<div class="plain">Must be licensed as either a Licensed Professional Counselor, a Licensed Marriage and Family Therapist, or a Licensed Clinical Social Worker</div>\r\n<div class="plain">Experience with all aspects of client care and documentation (i.e., intake assessments, treatment plans, progress notes, discharge summaries and follow-up)</div>\r\n<div class="plain">Experience with one-on-one counseling</div>\r\n<div></div>\r\n<div style="text-align: center;">\r\n<h4 class="plain" style="text-align: left;" align="center"><b>Send Resume to:</b></h4>\r\n<div class="plain" style="text-align: left;" align="center">Peace Tree Counseling, LLC</div>\r\n<div class="plain" style="text-align: left;" align="center">PO Box 817</div>\r\n<div class="plain" style="text-align: left;" align="center">Osceola, WI 54020</div>\r\n<div class="plain" style="text-align: left;" align="center">Or email peacetree@centurytel.net</div>\r\n</div>', 'Employment', '', 'publish', 'closed', 'closed', '', 'employment', '', '', '2018-05-21 19:20:06', '2018-05-21 19:20:06', '', 0, 'http://localhost:8888/?page_id=13', 0, 'page', '', 0),
