(103, 1, '2018-05-21 20:21:56', '2018-05-21 20:21:56', '<p class="plain">Profile:</p>\r\nMy career as a therapist and clinic director/owner has been among the most rewarding experiences of my life. Each day I am blessed with the opportunity to enter into people’s stories and to help them move toward greater healing and wholeness. During my years in therapeutic practice, I am repeatedly amazed at people’s resiliency, at their ability to overcome trauma and abuse, and at their capacity to triumph over incredible obstacles. Much of my work with clients revolves around helping them recognize their inner-strengths and developing new skills to facilitate happier, fuller, healthier living.', 'Val Zellmer', '', 'publish', 'closed', 'closed', '', 'val-zellmer', '', '', '2018-05-21 20:49:28', '2018-05-21 20:49:28', '', 9, 'http://localhost:8888/?page_id=103', 0, 'page', '', 0),
