(109, 1, '2018-05-21 20:29:05', '2018-05-21 20:29:05', '<p class="plain">Profile:</p>\r\n<p class="plain">Individuals are the experts on their own lives and experiences and it is my role to support them while providing tools and insights as they work to overcome current stressors. This approach helps me tailor to the unique needs of  each individual. When working with youth I utilize play and other creative arts to assist them in communicating emotions and working through difficulties. I enjoy working with many different people and supporting them through various life situations.</p>', 'Amanda Mikl', '', 'publish', 'closed', 'closed', '', 'amanda-mikl', '', '', '2018-05-21 21:14:38', '2018-05-21 21:14:38', '', 9, 'http://localhost:8888/?page_id=109', 0, 'page', '', 0),
