(117, 1, '2018-05-21 20:49:15', '2018-05-21 20:49:15', '<p class="plain">Profile:</p>\nMy career as a therapist and clinic director/owner has been among the most rewarding experiences of my life. Each day I am blessed with the opportunity to enter into people’s stories and to help them move toward greater healing and wholeness. During my years in therapeutic practice, I am repeatedly amazed at people’s resiliency, at their ability to overcome trauma and abuse, and at their capacity to triumph over incredible obstacles. Much of my work with clients revolves around helping them recognize their inner-strengths and developing new skills to facilitate happier, fuller, healthier living.', 'Val Zellmer', '', 'inherit', 'closed', 'closed', '', '103-autosave-v1', '', '', '2018-05-21 20:49:15', '2018-05-21 20:49:15', '', 103, 'http://localhost:8888/2018/05/21/103-autosave-v1/', 0, 'revision', '', 0),
(118, 1, '2018-05-21 20:49:16', '2018-05-21 20:49:16', '<p class="plain">Profile:</p>\r\nMy career as a therapist and clinic director/owner has been among the most rewarding experiences of my life. Each day I am blessed with the opportunity to enter into people’s stories and to help them move toward greater healing and wholeness. During my years in therapeutic practice, I am repeatedly amazed at people’s resiliency, at their ability to overcome trauma and abuse, and at their capacity to triumph over incredible obstacles. Much of my work with clients revolves around helping them recognize their inner-strengths and developing new skills to facilitate happier, fuller, healthier living.', 'Val Zellmer', '', 'inherit', 'closed', 'closed', '', '103-revision-v1', '', '', '2018-05-21 20:49:16', '2018-05-21 20:49:16', '', 103, 'http://localhost:8888/2018/05/21/103-revision-v1/', 0, 'revision', '', 0),
(119, 1, '2018-05-21 20:51:04', '2018-05-21 20:51:04', '<p class="plain">Profile:</p>\r\n<p class="plain">As a licensed clinical social worker, I have spent over 15 years working to strengthen family relationships in Polk County. My clinical practice is based on a client-focused, strengths-based approach in a calm, non-judgmental setting. Through a trusting, caring relationship, I partner with my clients to discover new solutions to life stressors. Clients will experience an increase in emotional health and overall well-being through this respectful collaboration.</p>', 'Kim Henningsgard', '', 'publish', 'closed', 'closed', '', 'kim-henningsgard', '', '', '2018-05-21 21:04:29', '2018-05-21 21:04:29', '', 9, 'http://localhost:8888/?page_id=119', 0, 'page', '', 0),
(120, 1, '2018-05-21 20:51:04', '2018-05-21 20:51:04', '<p class="plain">Profile:</p>\r\n<p class="plain">As a licensed clinical social worker, I have spent over 15 years working to strengthen family relationships in Polk County. My clinical practice is based on a client-focused, strengths-based approach in a calm, non-judgmental setting. Through a trusting, caring relationship, I partner with my clients to discover new solutions to life stressors. Clients will experience an increase in emotional health and overall well-being through this respectful collaboration.</p>', 'Kim Henningsgard', '', 'inherit', 'closed', 'closed', '', '119-revision-v1', '', '', '2018-05-21 20:51:04', '2018-05-21 20:51:04', '', 119, 'http://localhost:8888/2018/05/21/119-revision-v1/', 0, 'revision', '', 0),
