(122, 1, '2018-05-21 21:06:13', '2018-05-21 21:06:13', '<p class="plain">Profile:</p>\r\n\r\n<div class="plain">I am a licensed clinical social worker with ten years experience working with people seeking to build on their strengths and change the elements that cause stress in their relationships and their lives.</div>', 'Lisa Thompson', '', 'publish', 'closed', 'closed', '', 'lisa-thompson', '', '', '2018-05-21 21:06:13', '2018-05-21 21:06:13', '', 9, 'http://localhost:8888/?page_id=122', 0, 'page', '', 0),
(123, 1, '2018-05-21 21:06:13', '2018-05-21 21:06:13', '<p class="plain">Profile:</p>\r\n\r\n<div class="plain">I am a licensed clinical social worker with ten years experience working with people seeking to build on their strengths and change the elements that cause stress in their relationships and their lives.</div>', 'Lisa Thompson', '', 'inherit', 'closed', 'closed', '', '122-revision-v1', '', '', '2018-05-21 21:06:13', '2018-05-21 21:06:13', '', 122, 'http://localhost:8888/2018/05/21/122-revision-v1/', 0, 'revision', '', 0),
(124, 1, '2018-05-21 21:07:12', '2018-05-21 21:07:12', 'Profile:\r\n\r\nMy approach to therapy is integrative and collaborative, blending a variety of techniques and interventions in order best meet you and your family’s needs.My philosophy rests on a relational foundation that is respectful and empowering.I incorporate brain-based, narrative, solution-focused, cognitive-behavioral, and family interventions. These include art and play therapy techniques; parenting support and coaching; processing trauma and creating new narratives; creating and implementing behavior plans; and teaching mindfulness practices, relaxation techniques, and other coping skills.', 'Liz Wentland', '', 'publish', 'closed', 'closed', '', 'liz-wentland', '', '', '2018-05-21 21:07:12', '2018-05-21 21:07:12', '', 9, 'http://localhost:8888/?page_id=124', 0, 'page', '', 0),
(125, 1, '2018-05-21 21:07:12', '2018-05-21 21:07:12', 'Profile:\r\n\r\nMy approach to therapy is integrative and collaborative, blending a variety of techniques and interventions in order best meet you and your family’s needs.My philosophy rests on a relational foundation that is respectful and empowering.I incorporate brain-based, narrative, solution-focused, cognitive-behavioral, and family interventions. These include art and play therapy techniques; parenting support and coaching; processing trauma and creating new narratives; creating and implementing behavior plans; and teaching mindfulness practices, relaxation techniques, and other coping skills.', 'Liz Wentland', '', 'inherit', 'closed', 'closed', '', '124-revision-v1', '', '', '2018-05-21 21:07:12', '2018-05-21 21:07:12', '', 124, 'http://localhost:8888/2018/05/21/124-revision-v1/', 0, 'revision', '', 0),
(126, 1, '2018-05-21 21:08:13', '2018-05-21 21:08:13', '<p class="plain">Profile:</p>\r\n<p class="plain">I want you to leave our sessions feeling heard in a way you haven''t been before and feeling more courageous. Life can be difficult for us at times, and yet, resiliency exists and can be developed. When working with youth, I utilize play, creative arts and other intentional activities to assist them in communicating emotions and working through difficulties. I am comfortable working with you throughout your life, whether you are a youth or at the end of life. I enjoy engaging in the community by teaching wellness-related community education courses and offering groups to facilitate positive interpersonal relationships. It''s important to me to hear your story, to be solution-focused, person-centered, to understand how trauma and/or grief may have impacted you.</p>', 'Dani Mortenson', '', 'publish', 'closed', 'closed', '', 'dani-mortenson', '', '', '2018-05-21 21:14:51', '2018-05-21 21:14:51', '', 9, 'http://localhost:8888/?page_id=126', 0, 'page', '', 0),
(127, 1, '2018-05-21 21:08:13', '2018-05-21 21:08:13', '<p class="plain">Profile:</p>\r\n<p class="plain">I want you to leave our sessions feeling heard in a way you haven''t been before and feeling more courageous. Life can be difficult for us at times, and yet, resiliency exists and can be developed. When working with youth, I utilize play, creative arts and other intentional activities to assist them in communicating emotions and working through difficulties. I am comfortable working with you throughout your life, whether you are a youth or at the end of life. I enjoy engaging in the community by teaching wellness-related community education courses and offering groups to facilitate positive interpersonal relationships. It''s important to me to hear your story, to be solution-focused, person-centered, to understand how trauma and/or grief may have impacted you.</p>', 'Dani Mortenson', '', 'inherit', 'closed', 'closed', '', '126-revision-v1', '', '', '2018-05-21 21:08:13', '2018-05-21 21:08:13', '', 126, 'http://localhost:8888/2018/05/21/126-revision-v1/', 0, 'revision', '', 0),
(128, 1, '2018-05-21 21:08:59', '2018-05-21 21:08:59', '<p class="plain">Profile:</p>\r\n<p class="plain">Profile: The way I see it, therapy is a collaborative process, through which individuals, couples, and families can find healing and peace of mind. Therapy is a journey of self-discovery and my job as a therapist is to help facilitate that process. My approach to therapy is an integrative one, focusing on processing one’s thoughts and emotions, learning to access one’s strengths, and developing new skills to assist one on their journey.  I am currently in my second year of UW-Stout’s Marriage and Family Therapy graduate program. My background also includes two undergraduate degrees in psychology and human services. Cody is supervised by Val Zellmer, MS, LMFT.</p>', 'Cody Baxter', '', 'publish', 'closed', 'closed', '', 'cody-baxter', '', '', '2018-05-21 21:08:59', '2018-05-21 21:08:59', '', 9, 'http://localhost:8888/?page_id=128', 0, 'page', '', 0),
(129, 1, '2018-05-21 21:08:59', '2018-05-21 21:08:59', '<p class="plain">Profile:</p>\r\n<p class="plain">Profile: The way I see it, therapy is a collaborative process, through which individuals, couples, and families can find healing and peace of mind. Therapy is a journey of self-discovery and my job as a therapist is to help facilitate that process. My approach to therapy is an integrative one, focusing on processing one’s thoughts and emotions, learning to access one’s strengths, and developing new skills to assist one on their journey.  I am currently in my second year of UW-Stout’s Marriage and Family Therapy graduate program. My background also includes two undergraduate degrees in psychology and human services. Cody is supervised by Val Zellmer, MS, LMFT.</p>', 'Cody Baxter', '', 'inherit', 'closed', 'closed', '', '128-revision-v1', '', '', '2018-05-21 21:08:59', '2018-05-21 21:08:59', '', 128, 'http://localhost:8888/2018/05/21/128-revision-v1/', 0, 'revision', '', 0),
(130, 1, '2018-05-21 21:09:36', '2018-05-21 21:09:36', '<p class="plain" align="center"><b><i>We recognize that different age groups</i></b></p>\r\n<p class="plain" align="center"><b><i>have different needs and we provide specialized services</i></b></p>\r\n<p class="plain" align="center"><b><i> for children, youth, adults and older adults.</i></b></p>', 'Providers', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2018-05-21 21:09:36', '2018-05-21 21:09:36', '', 9, 'http://localhost:8888/2018/05/21/9-revision-v1/', 0, 'revision', '', 0),
(131, 1, '2018-05-21 21:13:00', '2018-05-21 21:13:00', '', 'Dani-2', '', 'inherit', 'open', 'closed', '', 'dani-2', '', '', '2018-05-21 21:13:00', '2018-05-21 21:13:00', '', 0, 'http://localhost:8888/wp-content/uploads/2018/05/Dani-2.jpg', 0, 'attachment', 'image/jpeg', 0),
(132, 1, '2018-05-21 21:14:07', '2018-05-21 21:14:07', '', 'Amanda-2', '', 'inherit', 'open', 'closed', '', 'amanda-2', '', '', '2018-05-21 21:14:07', '2018-05-21 21:14:07', '', 0, 'http://localhost:8888/wp-content/uploads/2018/05/Amanda-2.jpg', 0, 'attachment', 'image/jpeg', 0),
(133, 1, '2018-05-21 21:14:38', '2018-05-21 21:14:38', '<p class="plain">Profile:</p>\r\n<p class="plain">Individuals are the experts on their own lives and experiences and it is my role to support them while providing tools and insights as they work to overcome current stressors. This approach helps me tailor to the unique needs of  each individual. When working with youth I utilize play and other creative arts to assist them in communicating emotions and working through difficulties. I enjoy working with many different people and supporting them through various life situations.</p>', 'Amanda Mikl', '', 'inherit', 'closed', 'closed', '', '109-revision-v1', '', '', '2018-05-21 21:14:38', '2018-05-21 21:14:38', '', 109, 'http://localhost:8888/2018/05/21/109-revision-v1/', 0, 'revision', '', 0),
(134, 1, '2018-05-21 21:14:51', '2018-05-21 21:14:51', '<p class="plain">Profile:</p>\r\n<p class="plain">I want you to leave our sessions feeling heard in a way you haven''t been before and feeling more courageous. Life can be difficult for us at times, and yet, resiliency exists and can be developed. When working with youth, I utilize play, creative arts and other intentional activities to assist them in communicating emotions and working through difficulties. I am comfortable working with you throughout your life, whether you are a youth or at the end of life. I enjoy engaging in the community by teaching wellness-related community education courses and offering groups to facilitate positive interpersonal relationships. It''s important to me to hear your story, to be solution-focused, person-centered, to understand how trauma and/or grief may have impacted you.</p>', 'Dani Mortenson', '', 'inherit', 'closed', 'closed', '', '126-revision-v1', '', '', '2018-05-21 21:14:51', '2018-05-21 21:14:51', '', 126, 'http://localhost:8888/2018/05/21/126-revision-v1/', 0, 'revision', '', 0),
